// Initialize tracking after form load
frappe.web_form.after_load = () => {
    // Initialize Meta Pixel
    !function(f,b,e,v,n,t,s) {
        if(f.fbq)return;
        n=f.fbq=function(){n.callMethod?n.callMethod.apply(n,arguments):n.queue.push(arguments)};
        if(!f._fbq)f._fbq=n;n.push=n;n.loaded=!0;n.version='2.0';
        n.queue=[];
        t=b.createElement(e);
        t.async=!0;
        t.src=v;
        s=b.getElementsByTagName(e)[0];
        s.parentNode.insertBefore(t,s);
    }(window, document,'script','https://connect.facebook.net/en_US/fbevents.js');
    fbq('init', '1385332509097665');
    fbq('track', 'PageView');

    // Initialize Google Tag Manager
    (function(w,d,s,l,i){
        w[l]=w[l]||[];
        w[l].push({'gtm.start': new Date().getTime(),event:'gtm.js'});
        var f=d.getElementsByTagName(s)[0],
        j=d.createElement(s),
        dl=l!='dataLayer'?'&l='+l:'';
        j.async=true;
        j.src='https://www.googletagmanager.com/gtm.js?id='+i+dl;
        f.parentNode.insertBefore(j,f);
    })(window,document,'script','dataLayer','GTM-T452DBWT');

    // Initialize Google Analytics
    var gaScript = document.createElement('script');
    gaScript.async = true;
    gaScript.src = 'https://www.googletagmanager.com/gtag/js?id=G-KFS9KH8LC7';
    document.head.appendChild(gaScript);

    window.dataLayer = window.dataLayer || [];
    function gtag(){dataLayer.push(arguments);}
    gtag('js', new Date());
    gtag('config', 'G-KFS9KH8LC7');

    // Add GTM noscript iframe
    var noscript = document.createElement('noscript');
    var iframe = document.createElement('iframe');
    iframe.src = 'https://www.googletagmanager.com/ns.html?id=GTM-T452DBWT';
    iframe.height = '0';
    iframe.width = '0';
    iframe.style.display = 'none';
    iframe.style.visibility = 'hidden';
    noscript.appendChild(iframe);
    document.body.insertBefore(noscript, document.body.firstChild);
}

// Validate form before submission
frappe.web_form.validate = () => {
    // Track form submission attempt
    if (typeof fbq === 'function') {
        fbq('track', 'InitiateCheckout', {
            content_name: 'Contact Us Form',
            page_url: window.location.href
        });
    }
    return true; // Allow form submission
}

// Track successful form submission
let formSubmitted = false;
frappe.web_form.on('submit', () => {
    if (formSubmitted) return; // Prevent duplicate submissions
    formSubmitted = true;

    // Facebook Pixel event
    if (typeof fbq === 'function') {
        fbq('track', 'Lead', {
            content_name: 'Contact Us Form',
            page_url: window.location.href
        });
    }

    // Google Analytics event
    if (typeof gtag === 'function') {
        gtag('event', 'form_submission', {
            'event_category': 'Contact Form',
            'event_label': 'Contact Us Form Submit',
            'page_url': window.location.href
        });
    }

    // Google Tag Manager event
    if (typeof dataLayer !== 'undefined') {
        dataLayer.push({
            'event': 'form_submission',
            'form_name': 'contact_us',
            'form_type': 'Contact Form',
            'page_url': window.location.href
        });
    }
});

frappe.web_form.on('resume_link', (field, value) => {
    if (!frappe.utils.is_url(value)) {
        frappe.msgprint(__('Resume link not valid'));
    }
});

frappe.web_form.after_load = () => {
    if (window.location.pathname.endsWith("/new") && frappe.session.user) {
        let current_path = window.location.href;
        window.location.href = current_path.replace("/new", "/" + frappe.session.user);
    }
}
